import React from 'react';
import data from '../data';

const Process = () => {
	return(
        <div class="feature-grids row mt-4 mb-lg-6 mb-4 text-center">
        	{
        		data.process.map((process)=>(
        			<div class="col-lg-4" data-aos="fade-up">
					    <div class="bottom-gd px-3">
					        <span class={process.icon} aria-hidden="true"></span>
					        <h3 class="my-4">{process.title}</h3>
					        <p>{process.content}</p>
					    </div>
					</div>
 	      		))
        	}
        </div>
		);
}
export default Process;
